from enum import Enum
from typing import Dict, List

class Cluster(Enum):
    CLUSTER_0 = 0
    CLUSTER_1 = 1
    CLUSTER_2 = 2
    CLUSTER_3 = 3
    CLUSTER_4 = 4
    CLUSTER_5 = 5

class UserStory:
    def __init__(self, description: str, cluster: Cluster):
        self.description = description
        self.cluster = cluster

class FABSUser:
    def __init__(self, agency_name: str):
        self.agency_name = agency_name

    def submit_data(self, data: Dict):
        # Validate data
        if not self.validate_data(data):
            raise ValueError("Invalid data")

        # Submit data
        print(f"Data submitted successfully for {self.agency_name}")

    def validate_data(self, data: Dict) -> bool:
        # Check if data is valid
        # For example, check if required fields are present
        required_fields = ["name", "address", "zip"]
        for field in required_fields:
            if field not in data:
                return False

        return True

